/*
Database variable: DB

Add table to Database:
  function:   DB.addTable(name,fields);
        DB.addTable("Tablename", -Array of Column names-);
  
Insert row to table:
  function:   DB.insert(tableName,values);
        DB.insert("Tablename",-Array of Values to insert-);

Select row from table
  function: DB.selectRows(tableName,field,criteria);
        DB.selectRows("Tablename","ColumnName",-function selection is based on-);
  
Select a field from a row from a table
  function:   DB.selectFields(tableName,field,criteria);
        DB.selectFields("Tablename","ColumnName",-function selection is based on-);


*/




//Database Class###########################################################################################
function Database(name){
  this.name=name;
  this.tables=[];
}

Database.prototype.addTable=function(name,fields){
  this.tables[name]=(new Table(name,fields));
}

Database.prototype.insert=function(tableName,values){
  this.tables[tableName].insertRecord(values);
}

Database.prototype.selectRows=function(tableName,field,criteria){
  return this.tables[tableName].select(field,criteria);
}

Database.prototype.selectFields=function(tableName,field,criteria){
  return this.tables[tableName].selectField(field,criteria);
}

//Table Class###########################################################################################
function Table(name,fields){
  this.name=name;
  this.fields=fields;
  this.records=[];
}

Table.prototype.insertRecord=function(data){
  this.records.push(new Record(this.fields,data));
}

Table.prototype.select=function(field,criteria){
  var result=[];
  for (let i=0;i<this.records.length;i++){
    if(criteria){
      if(criteria(this.records[i].data[field])) result.push(this.records[i].data);
    }
    else result.push(this.records[i].data);
  }
  return result;
}

Table.prototype.selectField=function(field,criteria){
  var result=[];
  for (let i=0;i<this.records.length;i++){
    if(criteria){
      if(criteria(this.records[i].data[field])) result.push(this.records[i].data[field]);
    }
    else result.push(this.records[i].data[field]);
  }
  return result;
}

//Record Class###########################################################################################
function Record(fields,data){
  this.data=[];
  for(let i=0;i<fields.length;i++) this.data[fields[i]]=data[i];
}



